import { Link } from 'react-router-dom';
import css from './Footer.module.css';
import logo from '../../images/logo.png';
const HeroHome = () => {
  return (
    <div className={css.heroHome}>
      <h1 className={css.heroTitle}>
        Buy TikTok{' '}
        <span className={css.heroSubTitle}>
          Likes, Followers, Views & Live Views
        </span>
      </h1>
      <p className={css.heroText}>
        Don't settle for fake users. StellarLikes delivers followers, likes, and
        views from real users, delivered instantly. At the lowest possible
        prices.
      </p>
      <Link className={css.heroLink} to="/"></Link>
    </div>
  );
};

export default HeroHome;
